import React from 'react';
import './Banner.css';

const Banner = () => {
  return (
    <>
    <div className='banner'>
      <div className='black'> </div>
      <div className='white'> 
        <h1>Beauty Room</h1>
      </div>
      <div className='black'></div>
      <div className='white'> </div>
      <div className='black'> </div>
    </div>
    </>
  )
}

export default Banner;
